from pygame import mixer


class Player:
    def __init__(self):
        self.sounds = self._setup()
        self.channel = None

    def _setup(self):
        mixer.init()
        return [
            mixer.Sound(file)
            for file in Path(r"C:\Windows\Media").glob("*.wav")
            if file.is_file()
        ]

    def __len__(self):
        return len(self.sounds)

    def stop(self):
        if self.channel is not None:
            self.channel.stop()
            self.channel = None

    def play(self, index):
        if 0 <= index < len(self):
            self.stop()
            self.channel = self.sounds[index]
            self.channel.play()


def main():
    player = Player()
    while True:
        input("Enter to play a sound ")
        player.play(randint(0, len(player) - 1))


if __name__ == "__main__":
    main()

#include <vector>

class HashLPTable {
private:
    std::vector<int> table;
    int size;

public:
    HashLPTable(int size) : size(size) {
        table.resize(size, -1);
    }

    int hashFunction(int key) const {
        return key % size;
    }

    void insert(int key) {
        int index = hashFunction(key);
        while (table[index] != -1) {
            index = (index + 1) % size;
        }
        table[index] = key;
    }

    bool search(int key) {
        int index = hashFunction(key);
        int start = index;
        while (table[index] != key) {
            index = (index + 1) % size;
            if (index == start) {
                return false;
            }
        }
        return true;
    }

    void remove(int key) {
        int index = hashFunction(key);
        int start = index;
        while (table[index] != key) {
            index = (index + 1) % size;
            if (index == start) {
                return;
            }
        }
        table[index] = -1;
    }
};

