  ll n,k;
  cin>>n>>k;
  vector<ll>v(n),ans;
  cin(v);
  ll l=0,r=n,num=0,cost=0;
  while(l<=r){
    ll mid=l+(r-l)/2,sum=0;
    for(ll i=0;i<n;i++){
      ans.push_back(v[i]+mid*(i+1));
    }
    sort(all(ans));
    for(ll i=0;i<mid;i++){
      sum+=ans[i];
    }
    if(sum<=k){
      num=mid;
      cost=sum;
      l=mid+1;
    }else{
      r=mid-1;
    }
    ans.clear();
  }
  cout<<num<<" "<<cost<<"\n";
 }

